import React from 'react';
import { Switch, Route, Router } from 'react-router-dom';
import PostFormModal from './components/PostFormModal';
import PostList from './components/PostList';
import PostCommentsPage from './components/PostCommentsPage';
import UserPage from './components/UserPage';
import SubPage from './components/SubPage';
import TopSubsPanel from './components/TopSubsPanel';
import SearchResults from './components/SearchResults';
import NotFoundPage from './components/NotFoundPage';
import { Container } from '@material-ui/core/';
import { useMainPaperStyles } from './styles/muiStyles';
import Chat from './components/Chat/Chat';
import Join from './components/Join/Join';

const Routes = () => {
  const classes = useMainPaperStyles();

  return (
    <Switch>
      <Route exact path='/'>
        <Container disableGutters className={classes.homepage}>
          <div className={classes.postsPanel}>
            <PostFormModal />
            <PostList />
          </div>
          <TopSubsPanel />
        </Container>
      </Route>
      <Route exact path='/comments/:id'>
        <PostCommentsPage />
      </Route>
      <Route exact path='/u/:username'>
        <UserPage />
      </Route>
      <Route exact path='/r/:sub'>
        <SubPage />
      </Route>
      <Route exact path='/search/:query'>
        <SearchResults />
      </Route>
      <Route>
        <NotFoundPage />
      </Route>
      <Route exact path='/chat '>
        <Join />
      </Route>
      <Route exact path='/chatplus '>
        <Chat />
      </Route>
    </Switch>
  );
};

export default Routes;
